challenge.challenge_prompt:
You are given the following Python function:

def mysterious_sequence(n):
    seq = [1]
    for i in range(2, n+1):
        s = 0
        for j in range(1, i):
            if i % j == 0 and seq[j-1] % 2 == 1:
                s += j
        seq.append(s if s > 0 else 1)
    return seq

Let S be the sum of the first 50 elements of the sequence produced by mysterious_sequence(50). What is the value of S?

Your task: Compute and submit the value of S.

